/**
   Set RAM address
\param
   pDev         - pointer to the device interface
\param
   ram          - RAM flag : D_RAM or P_RAM
\param
   StartAddr    - RAM sector start address
\param
   StopAddr     - RAM sector end address
\return
   OPV_SUCCESS or OPV_ERROR
*/
static int32 Dwld_setRAM(u_int pci_iobase, BYTE cs, OPVX_FW_RAM ram, uint32 StartAddr, uint32 StopAddr)
{
	int32 cnt = 0, err = OPV_ERROR;
	uint16 pCmd[6] = {0};

	/* set Cmd 1 */
	pCmd[0] = CMD1_EOP | MEM_PAGE;
	/* Set Cmd 2 and Data words */
	switch(ram)
	{
		case OPVX_DRAM:
			pCmd[1] = ECMD_SET_DRAM_ADR;
			pCmd[2] = LOWWORD(StartAddr);
			cnt     = 1;
			if (StopAddr != 0)
			{
				pCmd[3]  = LOWWORD(StopAddr);
				cnt      = 2;
			}
		break;
		case OPVX_PRAM:
			pCmd[1] = ECMD_SET_PRAM_ADR;
			pCmd[2] = HIGHWORD(StartAddr);
			pCmd[3] = LOWWORD(StartAddr);
			cnt     = 2;
			if (StopAddr != 0)
			{
					pCmd[4]  = HIGHWORD(StopAddr);
					pCmd[5]  = LOWWORD(StopAddr);
					cnt = 4;
			}
			break;
	}
	if (cnt != 0)
		err = CmdWrite (pci_iobase, cs, pCmd, cnt);

	return err;
}

static void cpb2w (uint16* pWbuf,uchar *pBbuf, uint32 nB)
{
	uint32 i = 0, nW = nB >> 1;
	uint16 tmp;
	uchar *pBtmp = (uchar *) pBbuf;

	for ( i = 0; i < nW; i++ )
	{
		tmp = ((pBtmp[2*i+0] << 8) | (pBtmp[2*i+1] << 0));
		(pWbuf)[i] = (tmp);
	}
}


/**
   writes RAM firmware to chip
\param
   pDev      - pointer to the device interface
\param
   pData     - pointer to the data words
\param
   addr      - start address of sector
\param
   count     - number of words to write, assumed > 0.
\param
   ram       - P_RAM or D_RAM
\return
   OPV_SUCCESS or OPV_ERROR
\remarks
   Function implementation is Endiannes dependant. Appropriate macro is used to
   read uint16 data from Byte Data ptr argument.
*/
static  int32 writeRAM (u_int pci_iobase, BYTE cs, uchar* pData, uint32 addr, int32 count, OPVX_FW_RAM ram)
{
	int32  err;
	uint32 pos = 0;
	uchar  len; 
	uchar  ram_max_len [2] = {253, 252};
	uint16 eCmdRam [2] = {ECMD_DRAM, ECMD_PRAM}, pCmd [255]  = {0};

	err = Dwld_setRAM (pci_iobase, cs, ram, addr, 0);		/* set ram address */
	pCmd[0] = CMD1_EOP | MEM_PAGE;			/* Set Cmd 1 and 2 */
	pCmd[1] = eCmdRam [ram];

	/* do a check for PRAM to be sure that the sector contains entire set of instructions */
	if ((ram == OPVX_PRAM) && (count % 3 != 0))
	{
		return OPV_ERROR;
	}
	 /* write all data */
	while ((count > 0) && (err == OPV_SUCCESS))
	{
		if (count > ram_max_len [ram])			/* calculate length to download */
			len = ram_max_len [ram];
		else
			len = count;
		cpb2w (&pCmd [2], &pData [pos << 1], (len * 2));	/* unmap data */
		err = CmdWrite (pci_iobase, cs, pCmd, len);			/* write Data */
		pos += len;						/* increment position */
		count -= len;						/* decrement count */
	}
	return err;
}

/*******************************************************************************
Description:
   copy a byte buffer into a dword buffer respecting the endianess.
Argiments
   pDWbuf : DWord buffer
   pBbuf  : Byte buffer
   nB     : size of Bytes to be copied (must be a multiple of 4)
Return:
Remarks:
   No matter if uC supports big endian or little endian, this macro will still
   copy the data in the apropriate way for a big endian target chip like OPVXEC
   The pointer pBbuf might be not aligned to 32bit - therefore the dword is
   first copied byte wise into a 32bit variable (tmp) before swapping.
*******************************************************************************/

static void cpb2dw(uint32* pDWbuf, uchar* pBbuf, uint32 nB)
{
	uint32 i = 0, nDW = nB >> 2;
	uint32 tmp;
	uchar *pBtmp = (uchar *)pBbuf;

	for ( i = 0; i < nDW; i++ )
	{
		tmp =	((pBtmp[4*i+0] << 24) |
				(pBtmp[4*i+1] << 16) |
				(pBtmp[4*i+2] <<  8) |
				(pBtmp[4*i+3] <<  0));
				(pDWbuf)[i] = (tmp);
	}
}

static int32 readEdspCrc (u_int pci_iobase, BYTE cs, OPVX_FW_RAM ram, uint32 StartAddr, uint32 StopAddr, int32 count, uint16 *pCrc)
{
	int32 err = OPV_SUCCESS;
	uint16 pCmd[2] = {0}, pData [3] = {0};

	if (count == 0)
		return OPV_SUCCESS;
	pCmd[0] = CMD1_RD | CMD1_EOP | MEM_PAGE;	/* fill command */
	
	switch(ram)		/* set the crc-check variable */
	{
	case OPVX_DRAM:
			pCmd[1] = ECMD_CRC_DRAM;	/* set CMD 1*/
			if (StopAddr == 0)		/* end addr = start addr + (word_length - 1) for one sector */
					StopAddr = StartAddr + ((uint32)count - 1);
			break;
	case OPVX_PRAM:
			pCmd[1] = ECMD_CRC_PRAM;	/* set cmd 1 */
							  /* calculate stop address under following considerations :
								 1-  instruction number = (words number / 3)
								 2-  address jump   = 2 (even addresses)
								 3-  address Offset = (instruction number - 1) * Address jump
								 4-  stop address = Start address + address offset
							  */
			if (StopAddr == 0)
			{
				StopAddr = StartAddr + ((((uint32)count/WORD_PER_INSTRUCT) - 1) * PRAM_ADDRESS_JUMP);
			}
			if(StartAddr % 2 != 0 || StopAddr % 2 != 0)
			{
				err = OPV_ERROR;
				printk("ERROR: Given PRAM Start/Stop address not even!\n\r");
			}
			break;	
	}	
	if (err == OPV_SUCCESS)			/* Set the RAM area for CRC calculation */
		err = Dwld_setRAM(pci_iobase,cs, ram, StartAddr,StopAddr);
	if (err == OPV_SUCCESS)			/* Read the CRC */
		err = CmdRead (pci_iobase, cs, pCmd, pData, 1);
	if (err == OPV_SUCCESS)			/* set CRC value */
		*pCrc = pData [2];
	
	return err;
}


/**
   Checks if the mailbox is empty
\param
   pDev         - handle to the device structure
\param
   full_size    - mail box size expected when empty (MAX_PACKET_WORD/MAX_CMD_WORD)
\return
   OPV_SUCCESS or OPV_ERROR
\remarks
   BOX_CLEN is polled within given timeout in ms. The polling is done in steps of
   WAIT_POLLTIME microsec.
*/
static int32 OPVX_Host_CheckMbxEmpty  (u_int pci_iobase, BYTE cs,int32 full_size)
{
	int32 usec = 100 * 1000;
	uint16 box_clen_reg;

//	printk("check mailbox empty 0x%x\n\r",full_size);
	/* read BOX_CLEN in timeout till enough memory */
	do
	{
		OPVOS_Udelay(50);
		usec -= 50;      			
		box_clen_reg = opvx_uc_in(pci_iobase, cs,V2CPE_BOX_CLEN);		/* read mailbox size */ //read box_clen register
			
	//		printk(KERN_DEBUG "box_clen_register is 0x%04x\n\r",box_clen_reg);
			
		if (((box_clen_reg >> 8) & 0xff) == full_size)			/* check free inbox size */
		{
	//	printk("box_clen_register is 0x%x,mailbox empty!!!\n\r",full_size);
			return OPV_SUCCESS;
		}
		else if (usec <= 0)
		{
			printk("ERROR: mailbox not empty. box_clen_register is 0x%04x\n\r", box_clen_reg );
			return OPV_ERROR;
		}
	} while (usec > 0);
	printk("ERROR: time out mailbox not empty. box_clen_register is 0x%x\n\r", box_clen_reg );
	return OPV_ERROR;
}

/**
  Download PRAM or DRAM bynary
\param
   pDev         - pointer to the device interface
\param
   pByte        - Byte Buffer to download
\param
   byte_size    - size of the byte buffer
\param
   ram          - P_RAM/D_RAM
\param
   pRamCrc      - CRC of D_RAM/P_RAM
\return
    OPV_SUCCESS or OPV_ERROR
\remarks
   -  This function receives a byte buffer in a defined format
      <datasize, address, data> and writes to RAM according to this buffer.
   -  Function implementation is Endiannes dependant. Appropriate macro is used
      to read uint32 data size and address from Byte Data ptr argument.
   -  It is assumed that the buffers contain dummy words located at the end of
      the array  : PRAM = 3 dummy words, DRAM = 1 dummy word. These dummy words
      are downloaded also, but aren't considered for the CRC calculation.
*/
static int32 OPVX_DwldBinary (u_int pci_iobase, BYTE cs, uchar *pByte, uint32 byte_size, OPVX_FW_RAM ram, uint16 *pRamCrc)
{
	int32  err = OPV_SUCCESS;
	uint32 ramAddr= 0, data_size = 0, actual_pos = 0;
	uchar  dummy_len [2] = {1, 3};
	uint16 ramCrc;
	//static char empty_data[1024];

	//memset(empty_data, 0, 1024);

	if ((pByte == NULL) || (byte_size == 0))
	{
		printk("ERROR:no data to download\n\r");
		return OPV_ERROR;
	}
	err  = CmdWrite (pci_iobase, cs, (uint16 *)pEdspCrcReset [ram], 0);			/* reset internal CRC register */
	//   	printk("OPVX_DwldBinary:reset internal CRC register\n\r");
	if(err == OPV_ERROR)
	{
		printk("ERROR:edsp crc reset error\n\r");
	}
	while ((actual_pos < byte_size) && (err == OPV_SUCCESS))			/* do download */
	{
		cpb2dw (&data_size, &pByte[actual_pos], sizeof (int));		/* set address and data size */
		cpb2dw (&ramAddr, &pByte[actual_pos + 4], sizeof (int));
		actual_pos += (2 * sizeof (int));				/* calculate actual position */
		if (data_size == 0)
		{	
			return OPV_ERROR;
		}
		/* do the download according to ram  */
		err = writeRAM(pci_iobase, cs,&pByte [actual_pos], ramAddr, data_size, ram);
//     		printk("OPVX_DwldBinary:writeRAM actual_pos is 0x%04x\n\r",actual_pos);
		//err = writeRAM(pDev, empty_data, ramAddr, data_size, ram);
		if (err == OPV_SUCCESS)
		{
			/* calculate actual position */
			actual_pos += (data_size * 2);
			/* remove dummy words from data size before the CRC calculation */
			if (actual_pos == byte_size)
			data_size -= dummy_len [ram];
			/* in case of DRAM , ignore last sector of A-SP/B-SP for CRC calculation */
			if (ram == OPVX_DRAM)
			{
				uint32 ramAddrNext = 0;
				if (actual_pos != byte_size)
				{
					cpb2dw (&ramAddrNext, &pByte[actual_pos + 4], sizeof (int));
				}
				if (((ramAddr <= DRAM_ASP_ADDR_STOP) && (ramAddrNext >= DRAM_ASP_ADDR_STOP)) ||
					((ramAddr >= DRAM_BSP_ADDR_START) && (ramAddr <= DRAM_BSP_ADDR_STOP) &&
					  (actual_pos == byte_size)))
				{
					data_size -= 2;
				}
			}

			/* be sure all packets are out of the mailbox before continue... */
			err = OPVX_Host_CheckMbxEmpty (pci_iobase, cs, 0xff);

			if (err == OPV_SUCCESS)
			{
				err = readEdspCrc (pci_iobase, cs, ram, ramAddr, 0, data_size, pRamCrc);
			}
		}
	}
	/* read ram CRC from buffer and check */
	if (err == OPV_SUCCESS)
	{
		cpb2w (&ramCrc, &pByte[byte_size - 2], sizeof (uint16));
		if (ramCrc != *pRamCrc)
		{
			printk("OPVXEC CRC error: File=>CRC=0x%04X, EDSP=>CRC=0x%04X\r\n", ramCrc, *pRamCrc);
			err = OPV_ERROR;
		}
	}

	return err;
}

static int32  OPVX_Host_ResetEdsp (u_int pci_iobase,BYTE cs)
{
	uint16 glb_ctrl_reg;

	glb_ctrl_reg = opvx_uc_in(pci_iobase, cs, V2CPE_GLB_CTRL);		//read glb_ctrl_reg 0x04	
	V2CPE_GLB_CTRL_RST_SET(glb_ctrl_reg, 1);			/* RST = 1 : Reset EDSP */
	V2CPE_GLB_CTRL_ED_SET(glb_ctrl_reg, 1);				/* ED = 1 : Start address = 0xFFFFFE */
	V2CPE_GLB_CTRL_HBOOT_SET(glb_ctrl_reg, 0x3);			/* HBOOT = 0b0011 : Download microprogram */
	opvx_uc_out(pci_iobase, cs, V2CPE_GLB_CTRL, glb_ctrl_reg);	//write glb_ctrl_reg 0x04

	return OPV_SUCCESS;
}

/**
  Maximizes/Minimizes Command Mailbox size according to bMax.
\param
   pDev    - pointer to the device interface
\param
   bMax    - TRUE = Maximise Mailbox / FALSE = Minumize Mailbox
\return
    OPV_SUCCESS or OPV_ERROR
\remarks
   This function switch the mailbox size and checks if the switch was done
   by reading the mailbox inbox size and doing some comparisons.
*/
static int32 OPVX_Host_SwitchCmdMbxSize (u_int pci_iobase, BYTE cs,OPV_boolean_t bMax)
{
	uint16 glb_cfg_reg, box_clen_reg;
	uchar box_clen_wlen;

	glb_cfg_reg = opvx_uc_in(pci_iobase, cs, V2CPE_GLB_CFG);			/* read actual value of GLB_CFG register  0x06*/	
	V2CPE_GLB_CFG_FIFO_MD_SET(glb_cfg_reg, ((bMax == OPV_TRUE) ? 1 : 0));	/* FIFO_MD = 1 => maximize command mailbox size       	FIFO_MD = 0 => minimize command mailbox size */
	opvx_uc_out(pci_iobase, cs, V2CPE_GLB_CFG, glb_cfg_reg);	/* write back GLB_CFG register 0x06*/
	box_clen_reg = opvx_uc_in(pci_iobase, cs,V2CPE_BOX_CLEN);		/* read mailbox size */


	box_clen_wlen = ((box_clen_reg >> 8) & 0xff);	/* check inbox size */

	if (bMax == OPV_TRUE)
	{
		if (box_clen_wlen != 0xff)
		{
			printk("now  box_clen_reg should be 0xff00,in fact it is 0x%04x\n\r", box_clen_reg);
			return OPV_ERROR;
		}
		else
		{
//     			printk("switch mailbox size success! the size is 0xff\n\r");	
		}
	}
	else if (box_clen_wlen != 0x1f)
	{
		printk("now  box_clen_reg should be 0x1f00,in fact it is 0x%04x\n\r", box_clen_reg);
		return OPV_ERROR;
	}
	return OPV_SUCCESS;
}

static int32  OPVX_Host_CheckDldReady(u_int pci_iobase,BYTE cs)
{
	int32  usec = 50 * 1000;
	uint16 stat_reg;

	/* check download ready */
	do
	{
		OPVOS_Udelay(50);
		usec -= 50;
		stat_reg = opvx_uc_in(pci_iobase, cs, V2CPE_STAT);		//read status register

		if (stat_reg & 0x0080)
		{
			return OPV_SUCCESS;
		}
	} while (usec > 0);

	return OPV_ERROR;
}

static int32  OPVX_Host_StartEdsp  (u_int pci_iobase,BYTE cs)
{
	int32  err;
	uint16 pDwldEnd [2] = {CMD1_EOP, ECMD_DWLD_END};

	err =  CmdWrite (pci_iobase, cs, pDwldEnd, 0);	/* Send command for download end */

	if (err == OPV_SUCCESS)			   /* check in STAT register if Download Ready Bit is set */
		err = OPVX_Host_CheckDldReady(pci_iobase, cs);
		
	return err;
}

static int32 ActivateEdsp (u_int pci_iobase,OPVXEC_HW *ec,BYTE cs)
{
	int32 err;
	uint16 pCmd[] = { CMD1_EOP, ECMD_VERS };
	uint16 pData[ CMD_HEADER_CNT + CMD_VERS_FEATURES_EXT_LEN ];
	uint32 i;
//	OPVX_DEVICE *pVDev = pDev->pVinDev;

	err = OPVX_Host_CheckMbxEmpty(pci_iobase, cs, 0xff);
	OPVOS_Mdelay(1);
	if (err == OPV_SUCCESS)
	{
		err = OPVX_Host_SwitchCmdMbxSize(pci_iobase, cs, OPV_FALSE);
	}
	OPVOS_Mdelay(1);

	if (err == OPV_SUCCESS)
	{
		err = OPVX_Host_CheckMbxEmpty(pci_iobase, cs, 0x1f);
	}

	if (err == OPV_SUCCESS)
	{
		err = OPVX_Host_StartEdsp(pci_iobase, cs);
	}
	//deal later
	if (err == OPV_SUCCESS)
	{
//		printk("start edsp ok!!!\n\r");
		OPVOS_Mdelay(30);
		err = CmdRead(pci_iobase, cs,pCmd, pData, CMD_VERS_FEATURES_BASIC_LEN);		/* read edsp firmware version */
		if (err == OPV_SUCCESS)
		{	
			for (i=0; i < CMD_VERS_FEATURES_EXT_LEN; i++)	/* Set external and internal versions */
				ec->nEdspVers[i] = 0;
			for (i=0; i < CMD_VERS_FEATURES_BASIC_LEN; i++)
			{
				ec->nEdspVers[i] = pData[CMD_HEADER_CNT + i];
//				printk("EdspVers[%d]=%d\n",i,pData[CMD_HEADER_CNT + i]);
			}

			
			if (  ((pData[2] & ECMD_VERS_VERSION) > 16) || (((pData[2] & ECMD_VERS_VERSION) == 16) && (pData[3] >= 250)) )
			{
				err = CmdRead (pci_iobase,cs, pCmd, pData, CMD_VERS_FEATURES_EXT_LEN);
				if (err == OPV_SUCCESS)
				{
					ec->nEdspVers[2] = pData[CMD_HEADER_CNT + 2];
//						printk("EdspVers[2]=%d\n",pData[CMD_HEADER_CNT + 2]);
				}
			}
			
		}
		else 
			err = OPV_ERROR;
	}

   return err;
}


/**
  Download PRAM and DRAM firmware
\param
   pDev      - pointer to the device interface
\param
   pEdsp     - handle to OPVX_EDSP_FWDWLD structure
\return
    OPV_SUCCESS or OPV_ERROR
\remarks
    - This function assumes that pEdsp - if valid - has valid firmware DRAM and
      PRAM pointers. So the caller must make sure that the pointers are
      mapped accordingly.

    - This function executes the whole flow necessary for EDSP fimware download
      and returns DRAM and PRAM checksums after a sucessfull downlod.
*/

static  int32  Dwld_LoadFirmware(u_int pci_iobase, OPVXEC_HW *ec, BYTE cs, OPVX_EDSP_FWDWLD *pEdsp)
{
	int32  err;
	if (pEdsp == NULL)	/* valid pointer ? */
	{
		printk("ERROR:  struct OPVX_EDSP_FWDWLD = NULL\n\r");
		return OPV_ERROR;
	}
	err = OPVX_Host_CheckMbxEmpty  (pci_iobase, cs,0x1f);	  /* check if MBX is empty . This must be DONE before maximizing the mailbox */
	if (err == OPV_SUCCESS)				/* Maximize Inbox . New cmd inbox space will be MAX_PACKET_WORD */
	{
		err = OPVX_Host_SwitchCmdMbxSize (pci_iobase, cs, OPV_TRUE);
	}
	if (err == OPV_SUCCESS)			/* Reset EDSP before starting the download */
	{	
		err =  OPVX_Host_ResetEdsp (pci_iobase,cs);
	}

	/* now download firmware if user allows */
	if (err == OPV_SUCCESS)		/* write pram binary */
	{
		printk("OPVXEC:now start download pram firmware...\n\r");
		err = OPVX_DwldBinary (pci_iobase, cs,pEdsp->pPRAMfw, pEdsp->pram_size, P_RAM, &pEdsp->nPramCRC);
	}
	if (err == OPV_SUCCESS)		/* write dram binary */
	{
		printk("OPVXEC:now start download dram firmware...\n\r");
		err = OPVX_DwldBinary (pci_iobase, cs, pEdsp->pDRAMfw, pEdsp->dram_size, D_RAM, &pEdsp->nDramCRC);
	}

	if (err == OPV_SUCCESS)
	{
		err = ActivateEdsp (pci_iobase,ec,cs);
	}

	return err;
}

static int32 Dsp_SetIdleMode (u_int pci_iobase, BYTE cs, OPV_boolean_t bEn)
{
   int32    ret;
   uint16   pCmd[3] =  {0x0600, 0xE501, 0x0000};

   /* switch Idle Mode on or off */
   pCmd[2] = (bEn) ? 0x8000 : 0x0000;
   ret = CmdWrite (pci_iobase, cs, &pCmd[0], 1);
   return ret;
}

/*********************************deal later***************************************/
static int32 OPVX_Host_SetDevCaps (u_int pci_iobase,OPVXEC_HW *ec)
{
	ec->caps.nCOD = 4;				/* coder channels */
	ec->caps.nSIG   = 4;				/* signalling channels */
	ec->caps.nCPTD = ec->caps.nSIG;		/* Number of CPTD depends on the number of SIG modules */
	ec->caps.nPCM   = 8;				/* pcm channels */
	if (ec->nEdspVers[0] != 0xff)		/* Check for MFTD support if capability command is not present. */
	{
		if (((ec->nEdspVers[2] & ECMD_VERS_CAP) == 0) && ((ec->nEdspVers[2] & ECMD_VERS_MFTD) != 0))
		ec->caps.nMFTD = 4;
	}
	switch ((ec->nEdspVers[2] & ECMD_VERS_EVS) >> 2)	/* Check for Event support */
	{
		case 0:
			ec->caps.ETC = 0x01;		/* Event support for DTMF tones only */
			ec->caps.EPC = 0x01;		/* Event support for DTMF tones only */
			break;
		case 1:
			ec->caps.ETC = 0x0F;		/* Event support for DTMF tones, ANS, CNG, DIS */
			ec->caps.EPC = 0x0F;
			break;
		default:
			printk("\n\rWarning: Event support capability unknown!\n\r\n\r");
			/* do warning but continue */
			break;   
	}
	/* Check for extended  jitter buffer / event statistic capability  For 2CPE it is available for versions bigger than 16.250 */
	if ( ((ec->nEdspVers[0] & ECMD_VERS_VERSION) > 16) || (((ec->nEdspVers[0] & ECMD_VERS_VERSION) == 16) && (ec->nEdspVers[1] > 250) ) )
	{
		ec->caps.bExtendedJBsupported = 1;
	}
	if ((ec->nEdspVers[0] & ECMD_VERS_MV) == ECMD_VERS_MV_4)		/* Translate from version register to internal capability structure */
	{
		ec->caps.CODECS = CODEC_G726 | CODEC_G711;	/* G.711 and G.726 are supported in all variants */
		switch (ec->nEdspVers[0] & ECMD_VERS_FEATURES)
		{
			case ECMD_VERS_FEATURES_729ABE_G723:
				ec->caps.CODECS |= CODEC_G723_1;
				ec->caps.CODECS |= CODEC_G729AB;
				ec->caps.CODECS |= CODEC_G729E;
				ec->caps.CODECS |= CODEC_ILBC;
				ec->caps.nFAX = ec->caps.nCOD;
				ec->caps.nNLEC     = 3;
				ec->caps.nWLEC     = 3;
				ec->caps.nUTG      = 4;
				ec->caps.nUtgPerCh = 1;
			break;

			case ECMD_VERS_FEATURES_G729AB_G723:
				ec->caps.CODECS |= CODEC_G729AB;
				ec->caps.CODECS |= CODEC_G729E;
				ec->caps.CODECS |= CODEC_AMR;
				ec->caps.nFAX = ec->caps.nCOD;
				ec->caps.nNLEC     = 3;
				ec->caps.nWLEC     = 3;
				ec->caps.nUTG      = 4;
				ec->caps.nUtgPerCh = 1;
			break;

			case ECMD_VERS_FEATURES_G728_G723:
				ec->caps.CODECS |= CODEC_G729AB;
				ec->caps.CODECS |= CODEC_G729E;
				ec->caps.CODECS |= CODEC_G723_1;
				ec->caps.CODECS |= CODEC_ILBC;
				ec->caps.nFAX = ec->caps.nCOD;
				ec->caps.nNLEC     = 2;
				ec->caps.nWLEC     = 2;
				ec->caps.nUTG      = 8;
				ec->caps.nUtgPerCh = 2;
			break;

			default:
				printk("\n\rWarning: Unknown feature set\n\r");
				/* no error return here - we are just very limited in capabilities */
			break;
		}
	}
	else
	{
		printk("\n\rWarning: Unsupported Chip!\n\r\n\r");
		/* no error return here - we are just very limited in capabilities */
	}

	return OPV_SUCCESS;
}


static OPV_return_t OPVX_Get_FwCap (u_int pci_iobase,OPVXEC_HW *ec, BYTE cs)
{
	OPV_return_t  ret = OPV_ERROR;
	FWM_CAPS      capCmd;

	memset((void *)&capCmd, 0, sizeof(FWM_CAPS));	/* Initialise the firmware command for reading the capabilities */
	capCmd.value[0]   = CMD1_EOP;				/* Command Header */
	capCmd.value[1]   = ECMD_CAPS;
	capCmd.bit.length = 18;

	ret = CmdRead(pci_iobase, cs, (uint16 *)&capCmd, (uint16 *)&capCmd, capCmd.bit.length);

	if (ret != OPV_SUCCESS)
	{
		printk("INFO: Firmware capabilities-message not supported\n\r");
	}
	else /* Store the capabilities*/
	{
	//	printk("INFO: Capabilities were read with firmware message\n\r");
		ec->caps.nPCM = capCmd.bit.NPCM;	/* Number of PCM Channels */         
		ec->caps.nALI = capCmd.bit.NALI;	/* Number of Analog Line Channels */       
		ec->caps.nSIG = capCmd.bit.NSIG;	/* Number of Signaling Channels */         
		ec->caps.nCOD = capCmd.bit.NCOD;	/* Number of Coder Channels */         
		ec->caps.nAGC = capCmd.bit.NAGC;	/* Number of AGCs */         
		ec->caps.nEQ = capCmd.bit.NEQ;	/* Number of Equalizers */         
		ec->caps.nNLEC = capCmd.bit.NNLEC;	/* Number of Near-End LECs */         
		ec->caps.nWLEC = capCmd.bit.NWLEC;	/* Number of Combined Near-End/Far-End LECs */         
		ec->caps.nNWLEC = capCmd.bit.NNWLEC;	/* Number of Near-End Wideband LECs */         
		ec->caps.nWWLEC = capCmd.bit.NWWLEC;	/* Number of Combined Near-End/Far-End Wideband LECs */         
		ec->caps.nUTG = capCmd.bit.NUTG;	/* Number of Universal Tone Generators */         
		ec->caps.nDTMFG = capCmd.bit.NDTMFG;	/* Number of DTMF Generators */         
		ec->caps.nCIDS = capCmd.bit.NCIDS;	/* Number of Caller ID Senders */         
		ec->caps.nCIDR = capCmd.bit.NCIDR;	/* Number of Caller ID Receivers */         
		ec->caps.nCPTD = capCmd.bit.NCPTD;	/* Number of Call Progress Tone Detectors */         
		ec->caps.nMFTD = capCmd.bit.NMFTD;	/* Number of Modem and Fax Tone Discriminators (MFTDs) */         
		ec->caps.nFAX = capCmd.bit.NFAX;	/* Number of FAX Channels with FAX Relay (T.38) Support */         
		ec->caps.CODECS = capCmd.bit.CODECS;	/* Codecs */         
		ec->caps.CLOW = capCmd.bit.CLOW;	/* Maximum Number of Low Complexity Coders for the Coder Channel */         
		ec->caps.CMID = capCmd.bit.CLOW;	/* Maximum Number of Mid Complexity Coders for the Coder Channel */         
		ec->caps.CMAX = capCmd.bit.CMAX;	/* Maximum Number of High Complexity Coders for the Coder Channel*/         
		ec->caps.PCOD = capCmd.bit.PCOD;	/* PCM Channel Coders */         
		ec->caps.MFTDV = capCmd.bit.MFTDV;	/* MFTD Version */         
		ec->caps.TONES = capCmd.bit.TONES;	/* Tone Detection Capabilities */         
		ec->caps.FEAT = capCmd.bit.FEAT;	/* Features */         
		ec->caps.OVL = capCmd.bit.OVL;	/* Overlays */         
		ec->caps.EPC = capCmd.bit.EPC;	/* Event Playout Capabilities */         
		ec->caps.ETC = capCmd.bit.ETC;	/* Event Transmission Capabilities */         
		ec->caps.ES_1 = capCmd.bit.ES_1;		/* Echo Suppressor supported */
				 
		ec->caps.nUtgPerCh = (capCmd.bit.FEAT & 0x01) ? 2 : 1;		/* Number of UTG resources per channel (== SIG module), either 1 or 2 */
 
		ec->caps.bExtendedJBsupported = OPV_TRUE;		/* Support for extended jitter buffer statistics is yes by default */
 
		if (ec->caps.nWLEC > 0)	/* set the number of NLEC equal to the number of WLEC when supported */
		{
				ec->caps.nNLEC = ec->caps.nWLEC;
		}
		if(debug) {
			printk("OPVXEC: FWCAP: nPCM:%2u  nALM:%2u  nSIG:%2u  nCOD:%2u\n", ec->caps.nPCM, ec->caps.nALI, ec->caps.nSIG, ec->caps.nCOD);
			printk("OPVXEC: FWCAP: nNLEC:%2u nWLEC:%2u nAGC:%2u  nFAX:%2u\n", ec->caps.nNLEC, ec->caps.nWLEC, ec->caps.nAGC, ec->caps.nFAX);
			printk("OPVXEC: FWCAP: nUTG:%2u  UTG/CH:%2u nMFTD:%2u\n", ec->caps.nUTG, ec->caps.nUtgPerCh, ec->caps.nMFTD);
			printk("OPVXEC: FWCAP: nWWLEC:%2u nNWLEC:%2u ES_1:%2u nAGC %2u \n", ec->caps.nWWLEC, ec->caps.nNWLEC, ec->caps.ES_1, ec->caps.nAGC);
		}      
			
		/* Find out which protocol is supported by this firmware */
		ec->caps.bProtocolRTP = ((ec->nEdspVers[0] & ECMD_VERS_EDSP_PRT) == ECMD_VERS_EDSP_PRT_RTP) ? 1 : 0;
		ec->caps.bProtocolAAL = ((ec->nEdspVers[0] & ECMD_VERS_EDSP_PRT) == ECMD_VERS_EDSP_PRT_AAL) ? 1 : 0;

		ec->caps.nEventSupport = VIN_EVENT_SUPPORT_EXTENDED;
		
	}

	return ret;
}




static void OPVX_Set_DevCaps(u_int pci_iobase,OPVXEC_HW *ec, BYTE cs)
{
	//	OPV_TAPI_RESOURCE    nResource;
	int32 ret;

	ret = OPVX_Get_FwCap (pci_iobase,ec,cs);			/* Try to read the firmware capabilities with a message */
	if (ret != OPV_SUCCESS)
	{
		printk("INFO: Reading fw capabilities failed. Filling capabilities from chip version register\n\r");
		OPVX_Host_SetDevCaps(pci_iobase,ec);		/* call device dependent init function */
	}
}
