static void OPVX_PCM_Free_Ch_Structures (OPVX_CHANNEL *pCh)
{
	if (pCh->pPCM != OPV_NULL)
	{
		OPVOS_FREE(pCh->pPCM);
	}
}

static OPV_return_t OPVX_PCM_Allocate_Ch_Structures (OPVX_CHANNEL *pCh)
{
	OPVX_PCM_Free_Ch_Structures (pCh);

	pCh->pPCM = OPVOS_MALLOC(sizeof(OPVX_PCMCH_t));
	if (pCh->pPCM == NULL)
	{
		return OPV_ERROR;
	}
	memset(pCh->pPCM, 0, sizeof(OPVX_PCMCH_t));
	OPVOS_MutexInit (&(pCh->chAcc));

	return OPV_SUCCESS;
}

static uchar OPVX_CON_Get_PCM_SignalInput (OPVX_CHANNEL *pCh, uchar index)
{
	VINDSP_MODULE_t *pMod = &pCh->pCON->modPcm;

	/* Return either the normal or the muted signal index */
	return pMod->in[index].mute ? pMod->in[index].i_mute : pMod->in[index].i;
}

static OPV_return_t OPVX_PCM_Set_Inputs (u_int pci_iobase,OPVX_CHANNEL *pCh, BYTE cs)
{
	FWM_PCM_CH        *p_fw_pcm_ch;
	OPV_return_t      ret = OPV_SUCCESS;
	//	printk("INFO:OPVX_PCM_Set_Inputs called \n");
	/* update the signal inputs of this cached msg */
	p_fw_pcm_ch = &pCh->pPCM->fw_pcm_ch;

	OPVOS_MutexLock (&(pCh->chAcc));
	p_fw_pcm_ch->bit.i1 = OPVX_CON_Get_PCM_SignalInput (pCh, 0);
	p_fw_pcm_ch->bit.i2 = OPVX_CON_Get_PCM_SignalInput (pCh, 1);
	p_fw_pcm_ch->bit.i3 = OPVX_CON_Get_PCM_SignalInput (pCh, 2);
	p_fw_pcm_ch->bit.i4 = OPVX_CON_Get_PCM_SignalInput (pCh, 3);
	p_fw_pcm_ch->bit.i5 = OPVX_CON_Get_PCM_SignalInput (pCh, 4);

	ret = CmdWrite (pci_iobase, cs, p_fw_pcm_ch->value, CMD_PCM_CH_LEN);

	OPVOS_MutexUnlock (&(pCh->chAcc));

	return ret;
}

static void OPVX_CON_Free_Ch_Structures (OPVX_CHANNEL *pCh)
{
	if (pCh->pCON != OPV_NULL)
	{
		OPVOS_FREE(pCh->pCON);
	}
}

static void OPVX_CON_Init_PcmCh (OPVX_CHANNEL *pCh, uchar pcmCh)
{
	VINDSP_MODULE_t *pModPcm = &(pCh->pCON->modPcm);
	uchar i;

	pModPcm->nModType = VINDSP_MT_PCM;
	pModPcm->nSignal  = ECMD_IX_PCM_OUT0 + pcmCh;
	pModPcm->pCh      = pCh;

	for (i = 0; i < MAX_MODULE_SIGNAL_INPUTS; ++i)
		pModPcm->in[i].pParent = pModPcm;
}

static OPV_return_t OPVX_CON_Allocate_Ch_Structures (OPVX_CHANNEL *pCh)
{
	OPVX_CON_Free_Ch_Structures (pCh);

	pCh->pCON = OPVOS_MALLOC(sizeof(OPVX_CON_t));

	if (pCh->pCON == OPV_NULL)
	{
		return OPV_ERROR;
	}
	memset(pCh->pCON, 0, sizeof(OPVX_CON_t));

	return OPV_SUCCESS;
}

static void OPVX_PCM_Init_Ch (OPVX_CHANNEL *pCh,uchar pcmCh)
{
	OPVX_PCMCH_t *pPCM = pCh->pPCM;
	uchar     ch    = pCh->nChannel-1;	

	//   	printk("INFO: OPVX_PCM_Init_Ch called\n\r");

	OPVX_CON_Init_PcmCh (pCh, pcmCh);

	// PCM CH message 
	memset (pPCM->fw_pcm_ch.value, 0, sizeof(FWM_PCM_CH));
	pPCM->fw_pcm_ch.value[0]   = CMD1_EOP | pcmCh;
	pPCM->fw_pcm_ch.value[1]   = ECMD_PCM_CH;
	pPCM->fw_pcm_ch.bit.en     = 0;
	pPCM->fw_pcm_ch.bit.gain_1 = PCM_GAIN_0DB;
	pPCM->fw_pcm_ch.bit.gain_2 = PCM_GAIN_0DB;
	pPCM->fw_pcm_ch.bit.cod    = 2; 	// G711- ALaw 
	pPCM->fw_pcm_ch.bit.codnr  = ch;
	pPCM->fw_pcm_ch.bit.hp     = 1;

	// initially no LEC is assigned to this channel 
	pPCM->pcm_nelec = 0;

	// defaults for LEC window sizes in different modes 
	pPCM->lec_window_coefs[0] = 16; // NB NLEC LEN (ms) and FIX_WIN_LEN (ms) 
	pPCM->lec_window_coefs[1] = 16; // NB WLEC LEN (ms) 
	pPCM->lec_window_coefs[2] = 8;  // NB WLEC FIX_WIN_LEN (ms) 
}

static int32 OPVX_InitDevFWData(OPVXEC_HW *ec, BYTE cs)
{
	uchar i;
	int32 ret = OPV_SUCCESS;

	// Mark the available LEC resource in the firmware as free. Each bit set represents one available LEC resource 
	ec->availLecRes[cs-1] = (1 << ec->caps.nNLEC) - 1;

	//CON module
	for (i=0; i < 8; ++i)
	{
		if (ret == OPV_SUCCESS)
		{
			ret = OPVX_CON_Allocate_Ch_Structures (&ec->pChannel[cs-1][i]);
		}
		if (ret != OPV_SUCCESS)
		{
			printk("OPVX_CON_Allocate_Ch_Structures Err:VIN_ERR_NO_MEM\n\r");
		}
	}

	// Set the PCM channel numbering in the channels 

	for (i = 0; i < 8; i++)
	{
		ec->pChannel[cs-1][i].nPcmCh = i;
		ec->pChannel[cs-1][i].nChannel = i+1;
		ec->pChannel[cs-1][i].nPcmMaxResolution = (uchar)16;
	}
	// PCM module 
	for (i = 0; (ret == OPV_SUCCESS) && (i < ec->caps.nPCM); ++i)
	{
		OPVX_CHANNEL *pCh = &ec->pChannel[cs-1][i];

		ret = OPVX_PCM_Allocate_Ch_Structures (pCh);
		if (ret != OPV_SUCCESS)
		{
			printk("OPVX_PCM_Allocate_Ch_Structures Err:VIN_ERR_NO_MEM\n\r");
		}
		else
		{
			OPVX_PCM_Init_Ch(pCh, pCh->nPcmCh);
		}
	}

	return ret;
}

static int32 OPVX_Host_DefaultRegInit(u_int pci_iobase, BYTE cs)
{
	int32 err = OPV_SUCCESS;
	uchar i, offset;
	uint16 nRegMaskR;
	//   	uint16 nRegMaskF;
	uint16 nRegMasksR[2], nRegMasksF[2];
	uint16 RegStatIen;


	//   	printk("INFO: OPVX_Host_DefaultRegInit called\n\r");

	/* setup bitmask to enable the following HW/FW error (VIN_ERR_INT) interrupt sources */
	nRegMaskR = 0xfff0;

	/* write bitmask to enable HW/FW (VIN_ERR_INT) error interrupt sources */
	opvx_uc_out(pci_iobase,cs ,V2CPE_ERR_IEN, nRegMaskR);		/* write V2CPE_ERR_IEN register 0x12*/

	/* setup bitmask to enable the following EDSP (EDSPx_INT1) interrupt sources */
	nRegMasksR[0] = 0;
	nRegMasksF[0] = 0;

	nRegMasksR[0] |= 0x803f;

	/* disable UTG activation interrupt */
	nRegMasksR[0] &= ~(0x0008);
	/* enable UTG deactivation interrupt */
	nRegMasksF[0] |= 0x0008;
	nRegMasksR[0] |= 0x0100;
	/* setup bitmask to enable the following group of EDSP (EDSPx_INT2) interrupt sources */
	nRegMasksR[1] = 0;
	nRegMasksF[1] = 0;
	nRegMasksR[1] = 0x0020;    /* packet outbox overflow */

	nRegMasksR[1] |= 0x0001;    /* decoder change */

	/* write bitmasks to enable EDSP interrupts sources */
	for (i = 0, offset = 0; i < 4; i++, offset += 4)
	{
		/* write bitmask to enable EDSP (EDSPx_INT1) interrupts */
		opvx_uc_out(pci_iobase, cs, V2CPE_EDSP1_INTR1 + offset, nRegMasksR[0]);		/* write V2CPE_EDSP1_INTR1 register 0xa0*/
		opvx_uc_out(pci_iobase, cs, V2CPE_EDSP1_INTF1 + offset, nRegMasksF[0]);		/* write V2CPE_EDSP1_INTF1 register 0xd0*/
		/* write bitmask to enable EDSP (EDSPx_INT2) interrupts */
		opvx_uc_out(pci_iobase, cs, V2CPE_EDSP1_INTR2 + offset, nRegMasksR[1]);		/* write V2CPE_EDSP1_INTR2 register 0xa2*/
		opvx_uc_out(pci_iobase, cs, V2CPE_EDSP1_INTF2 + offset, nRegMasksF[1]);		/* write V2CPE_EDSP1_INTF2 register 0xd2*/
	}

	/* setup bitmask to enable the following top-level (STAT_INT) interrupt sources */
	RegStatIen = 0x4067; 	

	/* write bitmask for top-level interrupt (STAT_INT) sources */
	opvx_uc_out(pci_iobase, cs, V2CPE_STAT_IEN, RegStatIen);		/* write V2CPE_STAT_IEN register 0x0a*/

	return err;
}

static  int OPVX_Host_InitChip (u_int pci_iobase,OPVXEC_HW *ec,BYTE cs)
{
	int err = OPV_SUCCESS;
	WORD nRev = 0;
	OPVX_EDSP_FWDWLD  fwdwld;
	
	/* initialize mailbox protection semaphore */
	//deal later********************************************************************************************
	OPVOS_MutexInit (&(ec->mbxAcc));
	/* initialize share variables protection semaphore */
	OPVOS_MutexInit(&(ec->memberAcc));

	Host_SetDwldPtr(&fwdwld,pram,dram);	 			/* set OPVXEC download pointers */
	nRev = opvx_uc_in(pci_iobase, cs,  V2CPE_DUPO_REVISION); 	//read revision		modify CS_2  cs


	printk("OPVXEC:before download fw, OPVXEC revision register : 0x%04x\n\r",nRev);

	if ((err = Dwld_LoadFirmware(pci_iobase, ec,cs, &fwdwld)) == OPV_SUCCESS)	 // download firmware 
	{
		printk("OPVXEC:Download the firmware successfully!!!\n\r");
		nRev = opvx_uc_in(pci_iobase, cs,  V2CPE_DUPO_REVISION);		//read revision
		printk("OPVXEC:after download fw ,OPVXEC revision register : 0x%04x\n\r",nRev);	
	}
	else
	{
		printk("OPVXEC:ERROR:Download firmware failure!!!\n\r");
		goto error;
	}

	if (err == OPV_SUCCESS)
		OPVX_Set_DevCaps (pci_iobase, ec, cs);

	if ((err = OPVX_InitDevFWData(ec, cs)) == OPV_ERROR)		// set default firmware cache values now 
		goto error;

	if ((err = OPVX_Host_DefaultRegInit(pci_iobase, cs)) == OPV_ERROR)	// set register default values 
		goto error;

	if ((err = Dsp_SetIdleMode (pci_iobase, cs, OPV_TRUE)) == OPV_ERROR)	   	// set DSP idle mode 
		goto error;

	return OPV_SUCCESS;

error:
	OPVOS_MutexDelete(&(ec->mbxAcc));
	OPVOS_MutexDelete(&(ec->memberAcc));
	return OPV_ERROR;
}

static int32 OPVX_Basic_VoIPConf (u_int pci_iobase,BYTE cs)
{

	int32 err = OPV_SUCCESS;   
	uint16 pCmd [3] = {0};

	// EOP Cmd 
	pCmd [0] = CMD1_EOP;
	// EN = 1 
	pCmd [2] = 0x8000;

	pCmd [1] = ECMD_PCM_CTL;
	pCmd [2] = PCM_CTL_EN;
	err = CmdWrite (pci_iobase, cs, pCmd, 1);

	return err;	
}

static OPV_return_t OPVX_CON_ConnectConfigure (u_int pci_iobase,OPVXEC_HW *ec, BYTE cs)
{
	OPVX_CHANNEL *pCh;
	OPV_return_t err = OPV_SUCCESS;
	uchar  ch;

	OPVOS_MutexLock (&(ec->memberAcc));

	// write PCM module inputs 
	for (ch = 0; (err == OPV_SUCCESS) && (ch < ec->caps.nPCM); ++ch)
	{
		pCh = &ec->pChannel[cs-1][ch];
		pCh->pParent = ec;			//********************************************************deal later
		// call the module specific set function only if something was modified 
		if (pCh->pCON->modPcm.modified != OPV_FALSE)
		{
			// write PCM module inputs 
			err = OPVX_PCM_Set_Inputs (pci_iobase,pCh, cs);
			// clear the modified flag now that we updated the cached fw message 
			pCh->pCON->modPcm.modified = OPV_FALSE;
		}
	}

	OPVOS_MutexUnlock (&(ec->memberAcc));

	return err;
}

static OPV_return_t LOCAL_ConnectPrepare (VINDSP_MODULE_t* pSrc, VINDSP_MODULE_t* pDst, SIG_OUTPUT_SIDE nSide)
{
	int i, in = -1;
	VINDSP_MODULE_SIGNAL **pInput;
	uchar sig;
	uchar mute;

	/* get signal number and pointer to the output of the source module */
	if (nSide == LOCAL_SIG_OUT && pSrc->nModType == VINDSP_MT_SIG)
	{
		/* SIG module: use the local output (Out B) of the signalling module */
		pInput = &pSrc->pInputs2;
		sig    = pSrc->nSignal2;
		mute   = pSrc->nMute2;
	}
	else
	{
		/* PCM-, COD-, ALM-module: use the standard output of given module */
		/* SIG module: use the remote output (Out A) of the signalling module */
		pInput = &pSrc->pInputs;
		sig    = pSrc->nSignal;
		mute   = pSrc->nMute;
	}
	/* *pInput now points to the first input signal of the list of input signals
	connected to this output. sig contains the number of the signal in the
	signal array */

	/* return now if the output is already connected to one of the inputs */
	for (i = 0; i < MAX_MODULE_SIGNAL_INPUTS; i++)
	{
		if (pDst->in[i].i == sig)
		return OPV_SUCCESS;
	}
	/* find the index of a free input on the destination module */
	if (pDst->nModType == VINDSP_MT_SIG)
	{
		/* default input on signaling module is input 1 */
		in = LOCAL_SIG_IN;

		/* exception 1: coder connects always to input 2 */
		if (pSrc->nModType == VINDSP_MT_COD)
		in = REMOTE_SIG_IN;

		/* exception 2 for PCM: in advanced PCM it does not act as ALM, but as
		coder. This case is selected by using LOCAL_SIG_OUT on the PCM
		as it is connected to the SIG. This cannot be done when connecting
		PCM and SIG by user configuration. */
		if (pSrc->nModType == VINDSP_MT_PCM && nSide == LOCAL_SIG_OUT)
		{
			in = REMOTE_SIG_IN;
			//	   in = LOCAL_SIG_IN;		//modify by zyh
		}

		/* finally verify that the input selected is currently not in use */
		if (pDst->in[in].i != ECMD_IX_EMPTY)
		{
			printk("Input signal on SIG already in use\n\r");
			return OPV_ERROR;
		}
	}
	else
	{
		/* find free input on the destination module (COD, ALM or PCM) */
		for (i = 0; i < MAX_MODULE_SIGNAL_INPUTS; i++)
		{
			if (pDst->in[i].i == ECMD_IX_EMPTY)
			{
				in = i;
				break;
			}
		}
	}

	if (in == -1)
	{
		/* placed after the trace to get details on the modules (debug only) */
		printk("No free input on destination module - stop\n");
		return OPV_ERROR;
	}

	/* Connect output to the input */
	if (pDst->in[in].i != sig)
	{
		pDst->modified = OPV_TRUE;
		pDst->in[in].i = sig;
		pDst->in[in].mute += mute;
	}
	/* Set the pointer showing which output connects to this input */
	pDst->in[in].pOut = pSrc;
	/* Add the input to the linked list of all inputs attached to one output.
	Always add the element to the head of the list.*/
	pDst->in[in].pNext = *pInput;
	*pInput = &pDst->in[in];

	return OPV_SUCCESS;
}

static OPV_return_t LOCAL_DisconnectPrepare (VINDSP_MODULE_t* pSrc, VINDSP_MODULE_t* pDst, SIG_OUTPUT_SIDE nSide)
{
	int i, in = -1;
	VINDSP_MODULE_SIGNAL **pBase, *pTemp;
	uchar mute;

	/* find the input on the destination which is connected to the source */
	for (i = 0; i < MAX_MODULE_SIGNAL_INPUTS; i++)
	{
		if (pDst->in[i].pOut == pSrc)
		{
			in = i;
			break;
		}
	}

	if (in == -1)
	{
		/* placed after the trace to get details on the modules (debug only) */
		printk("OPVXEC:Given modules are not connected\n");
		return OPV_SUCCESS;
	}
	/* Get a pointer to the basepointer of the list of inputs connected. */
	if (nSide == LOCAL_SIG_OUT && pSrc->nModType == VINDSP_MT_SIG)
	{
		/* SIG-module only: inputs connected on local-side */
		pBase = &pSrc->pInputs2;
		mute = pSrc->nMute2;
	}
	else
	{
		/* PCM-, COD-, ALM-module: standard input */
		/* SIG module: inputs connected on remote-side */
		pBase = &pSrc->pInputs;
		mute = pSrc->nMute;
	}
	/* Get a pointer to the first element in the linked list of inputs. */
	pTemp = *pBase;
	/* pTemp now points to the first node in the list of input signals
	connected to this output. Now find the node of the input found
	above and remove this node from the linked list. */
	if (*pBase == &pDst->in[in])
	{
		/* special case: it is the first node so move the base pointer */
		*pBase = pDst->in[in].pNext;
	}
	else
	{
		/* Walk the list and try to find the node to be deleted. */
		while (pTemp != NULL && pTemp->pNext != &pDst->in[in])
		pTemp = pTemp->pNext;
		if (pTemp == NULL)
			/* not found! The data structure is corrupt - this should not happen*/
			return OPV_ERROR;
		/* unlink the node from the list */
		pTemp->pNext = pTemp->pNext->pNext;
	}
	/* clear this input -> connection is now removed */
	pDst->in[in].pNext = NULL;
	pDst->in[in].i     = ECMD_IX_EMPTY;
	pDst->in[in].i_mute= ECMD_IX_EMPTY;
	pDst->in[in].mute -= mute;
	pDst->in[in].pOut  = NULL;
	pDst->modified     = OPV_TRUE;

	return OPV_SUCCESS;
}

static OPV_return_t LOCAL_Module_Connect (OPV_TAPI_CONN_ACTION_t nAction, u_int pci_iobase,OPVXEC_HW *ec, BYTE cs, uint32 nCh1, OPV_TAPI_MAP_TYPE_t nChType1, uint32 nCh2, OPV_TAPI_MAP_TYPE_t nChType2)
{
	VINDSP_MODULE_t  *pMod1 = OPV_NULL,  *pMod2 = OPV_NULL;
	int32      err = OPV_SUCCESS;

	/* get pointers to the signal struct of the selected modules in the channels */
	switch (nChType1)
	{
	case OPV_TAPI_MAP_TYPE_PCM:
		if (nCh1 < ec->caps.nPCM)
			pMod1 = &ec->pChannel[cs-1][nCh1].pCON->modPcm;
		break;

	default:
		return OPV_ERROR;
	}

	switch (nChType2)
	{
	case OPV_TAPI_MAP_TYPE_PCM:
		if (nCh2 < ec->caps.nPCM)
			pMod2 = &ec->pChannel[cs-1][nCh2].pCON->modPcm;
		break;

		default:
		return OPV_ERROR;
	}

	if ((pMod1 == OPV_NULL) || (pMod2 == OPV_NULL))
	{
		return OPV_ERROR;
	}

	/* now pMod1 and pMod2 point to the modules to be connected/disconnected */

	if (nAction == OPV_TAPI_CONN_ACTION_CREATE)
	{
		// connect the forward direction 
		err = LOCAL_ConnectPrepare (pMod1, pMod2, 0);
		if (err == OPV_SUCCESS)
		{
			// connect the reverse direction 
			err = LOCAL_ConnectPrepare (pMod2, pMod1, 0);
		}
		if (err != OPV_SUCCESS)
		{
			printk("LOCAL_Module_Connect err: VIN_ERR_NO_FREE_INPUT_SLOT\n\r");
		}
	}
	if (nAction == OPV_TAPI_CONN_ACTION_REMOVE)
	{
		// disconnect the forward direction 
		err = LOCAL_DisconnectPrepare (pMod1, pMod2, 0);
		if (err == OPV_SUCCESS)
		{
			// disconnect the reverse direction 
			err = LOCAL_DisconnectPrepare (pMod2, pMod1, 0);
		}
		if (err != OPV_SUCCESS)
		{
			printk("LOCAL_Module_Connect err: VIN_ERR_CON_INVALID\n\r");
		}
	}

	if (err == OPV_SUCCESS)
		err = OPVX_CON_ConnectConfigure (pci_iobase,ec, cs);

	return (err == OPV_SUCCESS) ? OPV_SUCCESS : OPV_ERROR;
}



static OPV_return_t OPV_TAPI_LL_PCM_Channel_Add (u_int pci_iobase,OPVXEC_HW *ec, BYTE cs, uint32 nPcmCh,OPV_TAPI_MAP_PCM_t const *pMap)
{
	OPV_return_t ret;	
	
	ret = LOCAL_Module_Connect (OPV_TAPI_CONN_ACTION_CREATE, pci_iobase,ec, cs, nPcmCh, OPV_TAPI_MAP_TYPE_PCM, pMap->nDstCh, pMap->nChType);
	return ret;
}

static uchar get_free_lec_res (OPVXEC_HW *ec,BYTE cs)
{
	uint16   tmp = ec->availLecRes[cs-1];
	uchar    i;

	for (i = 0; i < ec->caps.nNLEC; i++)
	{
		if (tmp & 1)
		break;

		tmp = tmp >> 1;
	}

	ec->availLecRes[cs-1] &= ~((uint16)(1 << i));

	return i;
}



/**
   Configures the Near LEC in the PCM module
   \param   pCh        - pointer to OPVXEC channel structure
   \param   bEnLec     - OPV_FALSE : disable / OPV_TRUE : enable LEC
   \param   bEnNlp     - OPV_FALSE : disable / OPV_TRUE : enable NLP
   \param   bEnWLec    - OPV_FALSE : disable / OPV_TRUE : enable WLEC
                         implicitly enables LEC
   \param   bEnEs      - OPV_FALSE : disable / OPV_TRUE : enable ES

   \return
      OPV_SUCCESS or OPV_ERROR
*/
static int32 OPVX_PCM_Lec_Cfg(u_int pci_iobase,OPVXEC_HW *ec,BYTE cs, OPVX_CHANNEL *pCh, OPV_boolean_t bEnLec, OPV_boolean_t bEnNlp, OPV_boolean_t bEnWLec, OPV_boolean_t bEnEs)
{
	uint16 ch = 0;

	uint16   pCmd1[3];
	uint16   pCmd2[11];
	uchar    lec_res;
	static int first_enter = 1;

  /* coefficients for NLEC (can be used for all firmware versions) */
	static uint16 pcm_lec_nlec_coefs[5] =
	{
		//ECMD_NELEC_COEFS, 0x1048, 0x0808, 0x6060, 0x0060
		ECMD_NELEC_COEFS, 0x1048, 0x0808, 0x6060, 0x0060
	};

	/* coefficients for WLEC (can only be used for firmware with WLEC ) */
	static uint16 pcm_lec_wlec_coefs[7] =
	{
		ECMD_NELEC_COEFS, 0x1048, 0x0808, 0x6060, 0x0060, 0x0834, 0x0008
	};

	/* coefficients for Non Linear Processing */
	static uint16 pcm_lec_nlp_coefs[10] =
	{
		ECMD_NELEC_NLP, 0x1502, 0x4540, 0x0C40, 0x41FE,
		0x1106, 0x4647, 0x0D10, 0x6480, 0x0810
	};

	static const uint16 pcm_es_coefs[8] =
	{
		ECMD_ES_COEFS, 0x0E06, 0x1251, 0xC020, 0xF0C0, 0x0505, 0xF40D, 0x215F
	};

    ch = pCh->nChannel-1;

    if(1 == first_enter) {  /* setup nlec_coefs at first enter */
        pcm_lec_nlec_coefs[1] = nlec_coef1;
        pcm_lec_nlec_coefs[2] = nlec_coef2;
        pcm_lec_nlec_coefs[3] = nlec_coef3;
        pcm_lec_nlec_coefs[4] = nlec_coef4;
        if(1)
            printk("OPVXEC: NLEC Coeffs:\n"
                    "\tnlec_coef1=0x%04x, nlec_coef2=0x%04x, nlec_coef3=0x%04x, nlec_coef4=0x%04x\n", 
                        nlec_coef1 & 0xffff, nlec_coef2 & 0xffff,nlec_coef3 & 0xffff,nlec_coef4 & 0xffff);
        
        pcm_lec_wlec_coefs[1] = wlec_coef1;
        pcm_lec_wlec_coefs[2] = wlec_coef2;
        pcm_lec_wlec_coefs[3] = wlec_coef3;
        pcm_lec_wlec_coefs[4] = wlec_coef4;
        pcm_lec_wlec_coefs[5] = wlec_coef5;
        pcm_lec_wlec_coefs[6] = wlec_coef6;
        if(1)
            printk("OPVXEC: WLEC Coeffs:\n"
                    "\twlec_coef1=0x%04x, wlec_coef2=0x%04x, wlec_coef3=0x%04x, wlec_coef4=0x%04x\n\twlec_coef5=0x%04x, wlec_coef6=0x%04x\n", 
                        wlec_coef1 & 0xffff, wlec_coef2 & 0xffff,wlec_coef3 & 0xffff, 
                        wlec_coef4 & 0xffff, wlec_coef5 & 0xffff, wlec_coef6 & 0xffff);

        pcm_lec_nlp_coefs[1] = nlp_coef1;
        pcm_lec_nlp_coefs[2] = nlp_coef2;
        pcm_lec_nlp_coefs[3] = nlp_coef3;
        pcm_lec_nlp_coefs[4] = nlp_coef4;
        pcm_lec_nlp_coefs[5] = nlp_coef5;
        pcm_lec_nlp_coefs[6] = nlp_coef6;
        pcm_lec_nlp_coefs[7] = nlp_coef7;
        pcm_lec_nlp_coefs[8] = nlp_coef8;
        pcm_lec_nlp_coefs[9] = nlp_coef9;
        if(1)
            printk("OPVXEC: NLP Coeffs:\n"
                    "\tnlp_coef1=0x%04x, nlp_coef2=0x%04x, nlp_coef3=0x%04x, nlp_coef4=0x%04x\n"
                    "\tnlp_coef5=0x%04x, nlp_coef6=0x%04x, nlp_coef7=0x%04x, nlp_coef8=0x%04x\n"
                    "\tnlp_coef9=0x%04x\n",
                        nlp_coef1&0xffff, nlp_coef2&0xffff, nlp_coef3&0xffff, nlp_coef4&0xffff, 
                        nlp_coef5&0xffff, nlp_coef6&0xffff, nlp_coef7&0xffff, nlp_coef8&0xffff, 
                        nlp_coef9&0xffff);

        if(1)
            printk("OPVXEC: nlp=%s\n\twlec=%s\n", lec_nlp ? "ON":"OFF", wlec ? "ON":"OFF");

        first_enter = 0;    
    }

	if (ch >= ec->caps.nPCM)
	{
		// this is not an pcm channel 
		printk("Err:channel > pcm number\n\r");
		return OPV_ERROR;
	}

	/* set channel */
	pCmd1 [0] = CMD1_EOP | pCh->nPcmCh;

	if ((bEnLec == OPV_FALSE) && (bEnWLec == OPV_FALSE))    /* disable both NLEC/WLEC/NLP */
	{
		if(debug)
			printk("LEC disabled cs=%d, ch=%d\n\r", cs, ch);
		/* disable LEC */
		if (ec->pChannel[cs-1][ch].pPCM->pcm_nelec & PCM_NLEC_EN)   /* Disable and release NLEC after enabled */
		{
			/* release LEC resource back to the minimal resource management. */
			ec->availLecRes[cs-1] |= (1 << (ec->pChannel[cs-1][ch].pPCM->pcm_nelec & PCM_LECNR));  /* 2010 07 07 */
			/* clear LEC enable bits in cached command and keep everything else */
			ec->pChannel[cs-1][ch].pPCM->pcm_nelec &= ~(PCM_NLEC_EN | PCM_NLP_EN);
			/* set and write ALI NELEC command */
			pCmd1 [1] = ECMD_PCM_NEARLEC;
			pCmd1 [2] = ec->pChannel[cs-1][ch].pPCM->pcm_nelec;
			if(debug)
				printk("Disable NLP, EC cs=%d, ch=%d\n", cs, ch);
			return CmdWrite (pci_iobase, cs, pCmd1, 1);             /* disable NLEC and NLP, then return */
		}
	}
	else
	{
		/* configure and enable LEC */
		if(debug)
			printk("LEC enabled cs=%d, ch=%d\n\r", cs, ch);
		if (!(ec->pChannel[cs-1][ch].pPCM->pcm_nelec & PCM_NLEC_EN))    /* NLEC still not enabled */
		{
			/* allocate a LEC resource */
			lec_res = get_free_lec_res(ec,cs);
			/* clear command word cache */
			ec->pChannel[cs-1][ch].pPCM->pcm_nelec = 0;
			/* set channel in lec command */
			pCmd1 [2] = (PCM_NLEC_EN | lec_res);
			/* set channel in lec coefficient command */
			pCmd2 [0] = (CMD1_EOP | lec_res);
			/* set NLP coefficients only here where LEC is still unconfigured  */
			/* coefficients are set independently of the real activation later */
			memcpy(&pCmd2[1], pcm_lec_nlp_coefs, sizeof(pcm_lec_nlp_coefs));
			if(debug)
				printk("Write NLP Coeffs, cs=%d, ch=%d\n", cs, ch);

			if (CmdWrite (pci_iobase, cs, pCmd2, 9) != OPV_SUCCESS)
				return OPV_ERROR;
			/* if ES supported set coefficients independent of activation later */
			if (ec->caps.ES_1)
			{
				memcpy(&pCmd2[1], pcm_es_coefs, sizeof(pcm_es_coefs));
				if (CmdWrite (pci_iobase, cs, pCmd2, 7) != OPV_SUCCESS)            
					return OPV_ERROR;            
			}
		}
		else    /* NLEC already enabled */
		{
			/* No LEC resource is required, because LEC is already running */
			/* load command word from cache */
			pCmd1 [2] = ec->pChannel[cs-1][ch].pPCM->pcm_nelec;
			/* get the LEC resource which is used for this channel */
			lec_res = ec->pChannel[cs-1][ch].pPCM->pcm_nelec & PCM_LECNR;
			/* cross check with capabilities */
			if (lec_res >= ec->caps.nNLEC)
				return OPV_ERROR;
			/* set channel in lec coefficient command */
			pCmd2 [0] = CMD1_EOP | lec_res;
		}

		/* Set the WLEC coefficients */
		if ( bEnWLec == OPV_TRUE )
		{
			/* set WLEC coefficients defaults for PCM
			   WLEC Configuration: Normal operation mode for the window based LEC.
			   The window position as well as the filter coefficients are adapted by the LEC.
			   OLDP = 0, OLDC = 0
			   DCF = 1,
			   MW = 1, The de-correlation filter is part of the new WLEC only
			   and should be activated. */
			pCmd1 [2] &= ~(PCM_OLDC_EN | PCM_OLDP);
			pCmd1 [2] |=  (PCM_MW_EN | PCM_DCF_EN);
			/* set NLEC coefficients defaults for PCM */
			memcpy(&pCmd2[1], pcm_lec_wlec_coefs, sizeof(pcm_lec_wlec_coefs));
			/* Overwrite window size parameters */
			pCmd2[2] = ((uint16)(pCh->pPCM->lec_window_coefs [1]) << 8) | (pCmd2[2] & 0xFF);
			pCmd2[6] = ((uint16)(pCh->pPCM->lec_window_coefs [2]) << 8) | (pCmd2[6] & 0xFF);
			if(debug)
				printk("Write WLEC Coeffs, cs=%d, ch=%d\n", cs, ch);
			/* write NLEC coefficients command to PCM */
			if (CmdWrite (pci_iobase, cs, pCmd2, 6) != OPV_SUCCESS)
				return OPV_ERROR;
		}
		else /* WLEC=NLEC coeffs with extra 2 params, here we disable WLEC but enable NLEC */
		{
			/* set NLEC coefficients defaults for PCM */
			pCmd1 [2] &= ~(PCM_OLDC_EN | PCM_OLDP | PCM_MW_EN | PCM_DCF_EN);
			//pCmd1 [2] |= PCM_DTM_EN | PCM_NLPM_NOISE; /* miaolin change */
			//printk("> NLP use noise \n");
			memcpy(&pCmd2[1], pcm_lec_nlec_coefs, sizeof(pcm_lec_nlec_coefs));
			/* Overwrite window size parameters */
			pCmd2[2] = ((uint16)(pCh->pPCM->lec_window_coefs [0]) << 8) | (pCmd2[2] & 0xFF);
			pCmd2[6] = ((uint16)(pCh->pPCM->lec_window_coefs [0]) << 8) | (pCmd2[6] & 0xFF);

			if(debug)
				printk("Write NLEC Coeffs, cs=%d, ch=%d\n", cs, ch);
			/* write NLEC coefficients command to PCM */
			if (CmdWrite (pci_iobase, cs, pCmd2, 4) != OPV_SUCCESS)
				return OPV_ERROR;
		}

		/* Set the enable bit for NLP according to callers wishes */
		if(debug)
			printk("Set NLP=%s, cs=%d, ch=%d\n", (bEnNlp==OPV_FALSE)?"OFF":"ON", cs, ch);

		if (bEnNlp == OPV_FALSE)
			pCmd1 [2] &= ~PCM_NLP_EN;
		else
			pCmd1 [2] |= PCM_NLP_EN;

		/* If supported set the echo suppressor as requested */
		if (ec->caps.ES_1)
		{
			if (bEnEs == OPV_TRUE)
				pCmd1 [2] &= ~PCM_ES_EN;
			else
				pCmd1 [2] |= PCM_ES_EN;
		}

		/* only write to the device if the command word has changed */
		if (pCmd1 [2] != ec->pChannel[cs-1][ch].pPCM->pcm_nelec)
		{	
			/* set PCM NELEC command */
			pCmd1 [1] = ECMD_PCM_NEARLEC;
			if (CmdWrite (pci_iobase, cs,pCmd1, 1) != OPV_SUCCESS)
				return OPV_ERROR;
			ec->pChannel[cs-1][ch].pPCM->pcm_nelec = pCmd1 [2];
			if(debug)
				printk("Set NLEC to 0x%04x, cs=%d, ch=%d\n", ec->pChannel[cs-1][ch].pPCM->pcm_nelec, cs, ch);
		}
	}
	return OPV_SUCCESS;
}

/**
   sets the LEC configuration on the PCM.
\param pChannel        Handle to TAPI_CHANNEL structure
\param pLecConf        Handle to OPV_TAPI_LEC_CFG_t structure
\return Return value according to OPV_return_t
   - OPV_ERROR if an error occured
   - OPV_SUCCESS if successful
\remarks
   This function shouldn't be called when a disabling of PCM Nelec can have a
   fatal impact on the ongoing voice/fax connection. It will be more suitable to
   call the function at initialization / configuration time.
*/
static OPV_return_t OPV_TAPI_LL_PCM_Lec_Cfg (u_int pci_iobase,OPVXEC_HW *ec, BYTE cs, OPVX_CHANNEL   *pCh, TAPI_LEC_DATA_t const *pLecConf)
{
	int32       ret      = OPV_SUCCESS;
	OPV_boolean_t     bEnLec;
	OPV_boolean_t     bEnNlp;
	OPV_boolean_t     bEnWLec;
	OPV_boolean_t     bEnEs;


	/* Make sure that the PCM channel is activated */
	/*
	if (pCh->pPCM->fw_pcm_ch.bit.en != 1)
	{
	// PCM channel not activated 
	printk("Err:PCM channel not activated!\n\r");
	return OPV_ERROR;
	}
	*/
	switch (pLecConf->nOpMode)
	{
	case  OPV_TAPI_WLEC_TYPE_OFF:
		bEnLec  = OPV_FALSE;
		bEnWLec = OPV_FALSE;
		break;
	case  OPV_TAPI_WLEC_TYPE_NE:
	case  OPV_TAPI_WLEC_TYPE_NE_ES:
		bEnLec  = OPV_TRUE;
		bEnWLec = OPV_FALSE;
		pCh->pPCM->lec_window_coefs [0] = pLecConf->nNBNEwindow;
		break;
	case  OPV_TAPI_WLEC_TYPE_NFE:
	case  OPV_TAPI_WLEC_TYPE_NFE_ES:
		bEnLec  = OPV_TRUE;
		bEnWLec = OPV_TRUE;
		pCh->pPCM->lec_window_coefs [1] = pLecConf->nNBNEwindow + pLecConf->nNBFEwindow;
		pCh->pPCM->lec_window_coefs [2] = pLecConf->nNBNEwindow;
		break;
	default:
		//         SET_ERROR (VIN_ERR_FUNC_PARM);
		return OPV_ERROR;
	}

	bEnNlp = (pLecConf->bNlp == OPV_TAPI_LEC_NLP_OFF) ? OPV_FALSE : OPV_TRUE;

	bEnEs = (pLecConf->nOpMode == OPV_TAPI_WLEC_TYPE_NE_ES) ||
			(pLecConf->nOpMode == OPV_TAPI_WLEC_TYPE_NFE_ES) ?
			OPV_TRUE : OPV_FALSE;

	if(debug)
		printk("bEnLec = %x  bEnNlp = %x  bEnWLec = %x  bEnEs = %x\n",bEnLec,bEnNlp,bEnWLec,bEnEs);
	ret = OPVX_PCM_Lec_Cfg(pci_iobase,ec, cs, pCh, bEnLec, bEnNlp, bEnWLec, bEnEs);

	if(ret == OPV_ERROR)
		printk("ERROR:pcm_lec_cfg error.\n");

	return (ret == OPV_SUCCESS) ? OPV_SUCCESS : OPV_ERROR;

}

