static OPV_return_t OPVX_PCM_Activation (u_int pci_iobase,OPVXEC_HW *ec, BYTE cs, OPVX_CHANNEL *pCh , uint32 nMode,unsigned long TimeSlotRx,unsigned long TimeslotTX)
{
	uint32      IdxRx, BitValueRx;
	uint32      IdxTx, BitValueTx;
	FWM_PCM_CH        *pPcmCh;
	OPV_TAPI_PCM_CFG_t pPcmCfg;
	int32       ret = OPV_SUCCESS;
	pPcmCfg.nResolution = OPV_TAPI_PCM_RES_ALAW_8BIT;	
	pPcmCfg.nHighway = 0;
	pPcmCfg.nTimeslotRX = TimeSlotRx;
	pPcmCfg.nTimeslotTX = TimeslotTX;

	pPcmCh = &pCh->pPCM->fw_pcm_ch;

	//	printk("INFO:OPVX_PCM_Activation called\n\r");
	/* Activate Timeslots and set highway */
	switch (nMode)
	{
	case  0:
		/* the device variables PcmRxTs, PcmTxTs are global for all
		channels and must be protected against concurent tasks access  */
		OPVOS_MutexLock (&(ec->memberAcc));
		printk("PCM Deactivated\n\r");
		switch (pPcmCh->bit.cod)
		{
		case 0: /* OPV_TAPI_PCM_RES_LINEAR_16BIT */
			/* get the index in the time slot array. Each bit reflects one time
			slot. Modulo 32 separate the index of the array and the bit inside the field. */
			/* for 16 Bit mode, the next higher time slot has to be reserved too */
			IdxRx = (pPcmCh->bit.rts + 1) >> 5;
			BitValueRx = 1 << ((pPcmCh->bit.rts + 1) & 0x1F);
			IdxTx = (pPcmCh->bit.xts + 1) >> 5;
			BitValueTx = 1 << ((pPcmCh->bit.xts + 1) & 0x1F);

			/* Receive Slot checking */
			if ((ec->PcmRxTs[pPcmCh->bit.r_hw][IdxRx] & BitValueRx) == OPV_FALSE)
			{
				OPVOS_MutexUnlock (&(ec->memberAcc));
				printk("\n\rDRV_ERROR: Rx Slot is not available\n\r");
				ret = OPV_ERROR;
				goto end_fkt;
			}

			if ((ec->PcmTxTs[pPcmCh->bit.x_hw][IdxTx] & BitValueTx) == OPV_FALSE)
			{
				OPVOS_MutexUnlock (&(ec->memberAcc));
				printk("\n\rDRV_ERROR: Tx Slot is not available\n\r");
				ret = OPV_ERROR;            
				goto end_fkt;
			}

			/* reserve the time slots now, because the parameter are OK */
			ec->PcmRxTs[pPcmCh->bit.r_hw][IdxRx]  &= ~BitValueRx;
			ec->PcmTxTs[pPcmCh->bit.x_hw][IdxTx] &= ~BitValueTx;
			/* Fall through and do not 'break'!
			For 16-Bit PCM Mode, the next higher PCM time slot was reserved
			and now the used time slot will be reserved.
			That part is similar to the 8-Bit PCM Mode */
			/* break; */
		/*lint -fallthrough */
		case 2: /* OPV_TAPI_PCM_RES_ALAW_8BIT */
		case 3: /* OPV_TAPI_PCM_RES_ULAW_8BIT */
		default:
			/* get the index in the time slot array. Each bit reflects one time
			slot. Modulo 32 separate the index of the array and the bit inside the field. */
			IdxRx = pPcmCh->bit.rts >> 5;
			BitValueRx = 1 << (pPcmCh->bit.rts & 0x1F);
			IdxTx = pPcmCh->bit.xts >> 5;
			BitValueTx = 1 << (pPcmCh->bit.xts & 0x1F);

			/* Receive Slot checking */
			if ((ec->PcmRxTs[pPcmCh->bit.r_hw][IdxRx] & BitValueRx) == OPV_FALSE)
			{
				OPVOS_MutexUnlock (&(ec->memberAcc));
				printk("\n\rDRV_ERROR: Rx Slot is not available\n\r");
				ret = OPV_ERROR;
				goto end_fkt;
			}

			if ((ec->PcmTxTs[pPcmCh->bit.x_hw][IdxTx] & BitValueTx) == OPV_FALSE)
			{
				OPVOS_MutexUnlock (&(ec->memberAcc));
				printk("\n\rDRV_ERROR: Tx Slot is not available\n\r");
				ret = OPV_ERROR;
				goto end_fkt;
			}

			/* reserve the time slots now, because the parameter are OK */
			ec->PcmRxTs[pPcmCh->bit.r_hw][IdxRx]  &= ~BitValueRx;
			ec->PcmTxTs[pPcmCh->bit.x_hw][IdxTx] &= ~BitValueTx;
			/* Fall through and do not 'break'!
			For 16-Bit PCM Mode, the next higher PCM time slot was reserved
			and now the used time slot will be reserved.
			That part is similar to the 8-Bit PCM Mode */
			break;
		}
		/* disable channel: This will deactivate the timeslots */
		pPcmCh->bit.en = 0;
		/* write coefficients back */
		ret = CmdWrite (pci_iobase, cs, pPcmCh->value, CMD_PCM_CH_LEN);
		/* release share variables lock */
		OPVOS_MutexUnlock (&(ec->memberAcc));
		break;
	case 1:
		/* the device variables PcmRxTs, PcmTxTs are global for all 
		channels and must be protected against concurent tasks access */
		OPVOS_MutexLock (&(ec->memberAcc));
		if(0)
		  printk("PCM Activated\n\r");
		/* check timeslot allocation */
		switch (pPcmCfg.nResolution)
		{
		case OPV_TAPI_PCM_RES_LINEAR_16BIT:
			/* get the index in the time slot array. Each bit reflects one time
			slot. Modulo 32 separate the index of the array and the bit inside
			the field. */
			/* for 16 Bit mode, the next higher time slot has to be reserved too */
			IdxRx = (pPcmCfg.nTimeslotRX + 1) >> 5;
			BitValueRx = 1 << ((pPcmCfg.nTimeslotRX + 1) & 0x1F);
			IdxTx = (pPcmCfg.nTimeslotTX + 1) >> 5;
			BitValueTx = 1 << ((pPcmCfg.nTimeslotTX + 1) & 0x1F);

			/* Receive Slot checking */
			if (ec->PcmRxTs[pPcmCfg.nHighway][IdxRx] & BitValueRx)
			{
				OPVOS_MutexUnlock (&(ec->memberAcc));
				printk("\n\rDRV_ERROR: Rx Slot is not available\n\r");
				ret = OPV_ERROR;
				goto end_fkt;
			}

			if (ec->PcmTxTs[pPcmCfg.nHighway][IdxTx] & BitValueTx)
			{
				OPVOS_MutexUnlock (&(ec->memberAcc));
				printk("\n\rDRV_ERROR: Tx Slot is not available\n\r");
				ret = OPV_ERROR;
				goto end_fkt;
			}

			/* reserve the time slots now, because the parameter are OK */
			ec->PcmRxTs[pPcmCfg.nHighway][IdxRx] |= BitValueRx;
			ec->PcmTxTs[pPcmCfg.nHighway][IdxTx] |= BitValueTx;

			/* Fall through and do not 'break'!
			For 16-Bit PCM Mode, the next higher PCM time slot was reserved
			and now the used time slot will be reserved.
			That part is similar to the 8-Bit PCM Mode */
			/* break; */
		/*lint -fallthrough */
		case OPV_TAPI_PCM_RES_ALAW_8BIT:
		case OPV_TAPI_PCM_RES_ULAW_8BIT:
			/* get the index in the time slot array. Each bit reflects one time
			slot. Modulo 32 separate the index of the array and the bit inside the field. */
			IdxRx = pPcmCfg.nTimeslotRX >> 5;
			BitValueRx = 1 << (pPcmCfg.nTimeslotRX & 0x1F);
			IdxTx = pPcmCfg.nTimeslotTX >> 5;
			BitValueTx = 1 << (pPcmCfg.nTimeslotTX & 0x1F);

			/* Receive Slot checking */
			if (ec->PcmRxTs[pPcmCfg.nHighway][IdxRx] & BitValueRx)
			{
				OPVOS_MutexUnlock (&(ec->memberAcc));
				printk("\n\rDRV_ERROR: Rx Slot is not available\n\r");
				ret = OPV_ERROR;
				goto end_fkt;
			}

			if (ec->PcmTxTs[pPcmCfg.nHighway][IdxTx] & BitValueTx)
			{
				OPVOS_MutexUnlock (&(ec->memberAcc));
				printk("\n\rDRV_ERROR: Tx Slot is not available\n\r");
				ret = OPV_ERROR;
				goto end_fkt;
			}

			/* reserve the time slots now, because the parameter are OK */
			ec->PcmRxTs[pPcmCfg.nHighway][IdxRx] |= BitValueRx;
			ec->PcmTxTs[pPcmCfg.nHighway][IdxTx] |= BitValueTx;

			break;
		default:
			printk("\n\rDRV_ERROR: This resolution is unknown\n\r");
			OPVOS_MutexUnlock (&(ec->memberAcc));
			ret = OPV_ERROR;
			goto end_fkt;
		}

		/* activate Timeslots */
		switch (pPcmCfg.nResolution)
		{
		case  OPV_TAPI_PCM_RES_ALAW_8BIT:
			pPcmCh->bit.cod = 2;
			break;
		case OPV_TAPI_PCM_RES_ULAW_8BIT:
			pPcmCh->bit.cod = 3;
			break;
		case OPV_TAPI_PCM_RES_LINEAR_16BIT:
		default:
			pPcmCh->bit.cod = 0;
			break;
		}	
		pPcmCh->bit.xts  = pPcmCfg.nTimeslotTX;
		pPcmCh->bit.rts  = pPcmCfg.nTimeslotRX;
		pPcmCh->bit.r_hw = pPcmCfg.nHighway;
		pPcmCh->bit.x_hw = pPcmCfg.nHighway;
		pPcmCh->bit.en = 1;

		ret = CmdWrite (pci_iobase, cs, pPcmCh->value, CMD_PCM_CH_LEN);
		OPVOS_MutexUnlock (&(ec->memberAcc));
		break;
	default:
		ret = OPV_ERROR;
		goto end_fkt;
		/* break; */
	}

end_fkt:
	/* Check Error */
	if (ret == OPV_ERROR)
	{
		printk("DRV_ERROR: Error in (de)activating PCM Module!\n\r");
	}

	return ret;
}


int OPVXXP_INIT(u_int pci_iobase,OPVXEC_HW *ec,BYTE cs)
{
	unsigned int i, x;
	int32 err = OPV_SUCCESS;  
	OPV_TAPI_MAP_PCM_t pMap[4];
	TAPI_LEC_DATA_t pLecConf;
	
	for(i = 0; i < 4; i++)
	{
		pMap[i].nDstCh = i*2+1;							//pcm channel add
		pMap[i].nChType = OPV_TAPI_MAP_TYPE_PCM;  
	}
	
	//pLecConf.nOpMode = OPV_TAPI_WLEC_TYPE_NFE_ES;
	if(wlec)
		pLecConf.nOpMode = OPV_TAPI_WLEC_TYPE_NFE;
	else
		pLecConf.nOpMode = OPV_TAPI_WLEC_TYPE_NE;

	if(lec_nlp)
		pLecConf.bNlp = OPV_TAPI_LEC_NLP_ON;
	else
		pLecConf.bNlp = OPV_TAPI_LEC_NLP_OFF;

	pLecConf.nNBNEwindow = 16;//OPV_TAPI_WLEN_WSIZE_16;
	pLecConf.nNBFEwindow = 16;

	err=vpm_ec_probe(pci_iobase,cs);
	if (err == OPV_ERROR) {
		return OPV_ERROR;
	}

	err = OPVX_Host_InitChip(pci_iobase,ec,cs);
	if (err == OPV_ERROR) {
		return OPV_ERROR;
	}
	
	if(err == OPV_SUCCESS)
	{
		err = OPVX_Basic_VoIPConf(pci_iobase,cs);
	}
	
	for(i = 0 ; i < 4; i++)
	{
		if(err == OPV_SUCCESS)
		{
				err = OPV_TAPI_LL_PCM_Channel_Add(pci_iobase,ec, cs, i*2, &pMap[i]);	
		}
	}
	
	for(x = 0,i = (cs - 1)*4 ; x < 4 ; x++, i++)
	{		
		if (err == OPV_SUCCESS)
		{
			err = OPVX_PCM_Activation (pci_iobase, ec,cs, &ec->pChannel[cs-1][x*2], 1, ((i/4)*16) + ((i%4)*4) ,((i/4)*16) + ((i%4)*4) + 1);
			//printk("---------ch=%d,rxslot=%d,txslot=%d--------------\n",x*2,((i/4)*16) + ((i%4)*4),((i/4)*16) + ((i%4)*4) + 1);
		}
		if (err == OPV_SUCCESS)
		{
			err = OPVX_PCM_Activation (pci_iobase, ec , cs, &ec->pChannel[cs-1][x*2+1], 1, ((i/4)*16) + ((i%4)*4) + 1 ,((i/4)*16) + ((i%4)*4));
			//printk("---------ch=%d,rxslot=%d,txslot=%d--------------\n",x*2+1,((i/4)*16) + ((i%4)*4) + 1 ,((i/4)*16) + ((i%4)*4));
		}
	}
	for(i = 0; i < 4; i++)
	{	
		if(err == OPV_SUCCESS)
		{
		  TAPI_LEC_DATA_t pLecConf2;
		  
			err =OPV_TAPI_LL_PCM_Lec_Cfg(pci_iobase,ec, cs, &ec->pChannel[cs-1][i*2+1],&pLecConf);
			pLecConf2.nOpMode = OPV_TAPI_WLEC_TYPE_OFF;
			pLecConf2.bNlp = OPV_TAPI_LEC_NLP_OFF;
			pLecConf2.nNBNEwindow = OPV_TAPI_WLEN_WSIZE_16;
			pLecConf2.nNBFEwindow = OPV_TAPI_WLEN_WSIZE_16;
			err =OPV_TAPI_LL_PCM_Lec_Cfg(pci_iobase,ec, cs, &ec->pChannel[cs-1][i*2],&pLecConf2);   //+
			if(err != OPV_SUCCESS)
				printk(KERN_EMERG " debug: %s err=%x\n", __func__, err);
		}
	}
	if(err != OPV_SUCCESS){
		OPVXXP_EXIT(ec);
	}
	return err;
}

void OPVXXP_EXIT(OPVXEC_HW *ec)
{
	int i,x;

	/* delete device mutexes */
	OPVOS_MutexDelete (&(ec->mbxAcc));
	OPVOS_MutexDelete (&(ec->memberAcc));

	/* delete channel mutexes */
	for(x = 0; x < 2; x++)
	{
		for (i = 0; i < 8; i++)
		{
			OPVOS_MutexDelete (&(ec->pChannel[x][i].chAcc));
		}
	}

	/* free fw module related structures */
	for(x = 0; x < 2; x++)
	{
		for (i = 0; i < 8; i++)
		{
			OPVX_CON_Free_Ch_Structures (&ec->pChannel[x][i]);
		}
	}
	for(x = 0; x < 2; x++)
	{
		for (i = 0; i < 8; ++i)
		{
			OPVX_PCM_Free_Ch_Structures (&ec->pChannel[x][i]);
		}
	}
}

int opvx_set_ec(u_int pci_iobase, OPVXEC_HW *ec, int cs, int ch, int onoff)
{
	OPVX_CHANNEL *pCh = &ec->pChannel[cs-1][ch*2+1];
	int bEnLec, bEnNlp, bEnWlec, bEnEs;

	bEnLec = onoff ? 1 : 0;
	bEnNlp = (bEnLec & lec_nlp) ? 1 : 0;
	bEnWlec = (bEnLec & wlec) ? 1 : 0;
	bEnEs = 0;

	return OPVX_PCM_Lec_Cfg(pci_iobase, /*u_int pci_iobase*/
			ec,         /*OPVXEC_HW *ec*/
			cs,         /* BYTE cs, */
			pCh,        /*OPVX_CHANNEL *pCh*/
			bEnLec,     /*OPV_boolean_t bEnLec, */
			bEnNlp,     /*OPV_boolean_t bEnNlp, */
			bEnWlec,    /*OPV_boolean_t bEnWLec, */
			bEnEs);     /*OPV_boolean_t bEnEs   */
}

EXPORT_SYMBOL(opvx_set_ec);
EXPORT_SYMBOL(OPVXXP_INIT);
EXPORT_SYMBOL(OPVXXP_EXIT);

